import { Card } from 'reactstrap';

export default class CurrentDraft extends Component {
    constructor(props) {
        super(props);
        this.state = {
            currentPlayerNo: 0,
            currentPlayerName:""

        };
    }
    render() {
        return(
            <div>
             <body></body>
              {this.getPlayers(this.props.playerList)}
                {this.getCurrentPlayer()}
            </div>
        )
    }

    getPlayers(currentList){
        var tempList = [];
        console.log(currentList);
        for(const player of []){
            tempList.push(
                <Card>
                    <Card.Body>
                        <Card.Title>Player {player.playerNum}</Card.Title>
                        <Card.Subtitle>{player.playerDrafted}</Card.Subtitle>
                    </Card.Body>
                </Card>
            )
        }
        return tempList;
    }

    getCurrentPlayer(){
        var tempList2 = [];
        tempList2.push(
            <Card>
